  \"2016-05-25T00:52:39.828508\",\n\t\"name\": \"enhanced-terminal-voice-switch\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Enhanced Terminal Voice Switches/Interim
  Voice Switch Replacement (ETVS/IVSR) are installed at Airport Traffic Control Tower
  (ATCT) and Terminal Radar Approach Control (TRACON) facilities and can be configured
  up to 80 air traffic controller positions.  The ETVS is a modular system.  The size
  of the switch is based on the number of controller positions in the facility.The
  ETVS (installed in the ATCT) provides the air traffic control (ATC) operational
  ground-to-ground (G/G) voice communications intraconnectivity between controllers
  within an ATCT (intercom), interconnectivity between controllers in separate ATCTs
  (interphone), and interconnectivity between ATCT controllers and TRACON controllers/Air
  Route Traffic Control Center (ARTCC) controllers/Flight Service Station (FSS) specialists/David
  J. Hurley Air Traffic Control System Command Center (ATCSCC) specialists.  Air-to-ground
  (A/G) radio connectivity between ATCT controllers and pilots is also supported by
  the ETVS.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
